import React, { Component } from 'react';


import Aluno from './aluno.svg';
class SideMenuDashbaord extends Component {
    render = () => {
        return (
            <div style={{
                width: 300,
                backgroundColor: '#F1F1F1',
                alignItems: 'center',
                justifyContent: 'center',
                display: 'flex'
            }}>

                <div style={{
                    alignItems: 'center',
                    display: 'flex',
                    justifyContent: 'center',
                    flexDirection: 'column'
                }} >
                    <img src={require("./aluno.svg")}></img>
                    <p>Aline Machado</p>
                    <p>9ยบ Ano,  Turma C</p>
                    <div style={{
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                        flexDirection: 'row',
                    }}>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                    </div>
                </div>
                <div style={{
                    alignItems: 'center',
                    justifyContent: 'center',
                    display: 'flex',
                    flexDirection:'column'
                }}>
                    <div style={{
                        display:'flex',
                        flex:1,
                        flexDirection:'column   ' 
                    }}>
                    </div>
                    <div>
                    </div>
                </div>
            </div >


        )
    }
}

export default SideMenuDashbaord;
